window.bookSummaryJSON = "<p><b>Lux is finishing his Aeronautical Engineering degree at Georgia Tech.</b></p> <p>His father begins to support him again, but he is starting to get noticed a little too widely outside his peers. He has to hire a 24/7 security team. The Israeli intelligence operatives, alerted by Professor Helmann, are the first to arrive.</p> <p>SpaceX becomes interested when Lux tries to obtain spacesuits suitable for extravehicular activity in a vacuum. Lux starts flying frequently and upgrades SpaceX rocket shells with Blakely thrusters. Chinese operatives attempt to obtain the tech by any means and won't stop.</p> <p>The deepfake video personality, Lummi, has reached popstar status and is pressured to give live international concerts of her music. The deepfake videos produced by his AI, Anna, continue to improve and produce income to fund his research.</p> <p>Lux applies to MIT for a Ph.D. in their AeroAstro department to investigate the strange field effects of his discovery. The mystery of the effect is beginning to unravel.</p>"; 
